import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    payload = fetch("/api");
    payloadJSON = payload.json();
    setData(payloadJSON);
  })

  return (
    <div className="App">
      <header className="App-header">
      {data ? <p>{data.payloadJSON}</p> : <p>Loading...</p>}
      </header>
    </div>
  );
}

export default App;
